def letter(io):
    rtuyi = {

    }
    for t in io:
        if t not in tuple (rtuyi.keys()):
            rtuyi[t] = 1
        else:
            rtuyi[t] += 1
    return rtuyi
poem = "          "
iu = letter(poem)
print("в строке: %s" % (poem))
for b in list(iu.keys()):
    print(f'{iu[b]} символов {b}')